prompt: "Q: Write python code to solve the following coding problem that obeys the\
  \ constraints and passes the example test cases. The output code needs to read from\
  \ and write to standard IO. Please wrap your code answer using ```:\nEach New Year\
  \ Timofey and his friends cut down a tree of n vertices and bring it home. After\
  \ that they paint all the n its vertices, so that the i-th vertex gets color ci.\n\
  \nNow it's time for Timofey birthday, and his mother asked him to remove the tree.\
  \ Timofey removes the tree in the following way: he takes some vertex in hands,\
  \ while all the other vertices move down so that the tree becomes rooted at the\
  \ chosen vertex. After that Timofey brings the tree to a trash can.\n\nTimofey doesn't\
  \ like it when many colors are mixing together. A subtree annoys him if there are\
  \ vertices of different color in it. Timofey wants to find a vertex which he should\
  \ take in hands so that there are no subtrees that annoy him. He doesn't consider\
  \ the whole tree as a subtree since he can't see the color of the root vertex.\n\
  \nA subtree of some vertex is a subgraph containing that vertex and all its descendants.\n\
  \nYour task is to determine if there is a vertex, taking which in hands Timofey\
  \ wouldn't be annoyed.\n\nInput\n\nThe first line contains single integer n (2 \u2264\
  \ n \u2264 105) \u2014 the number of vertices in the tree.\n\nEach of the next n\
  \ - 1 lines contains two integers u and v (1 \u2264 u, v \u2264 n, u \u2260 v),\
  \ denoting there is an edge between vertices u and v. It is guaranteed that the\
  \ given graph is a tree.\n\nThe next line contains n integers c1, c2, ..., cn (1\
  \ \u2264 ci \u2264 105), denoting the colors of the vertices.\n\nOutput\n\nPrint\
  \ \"NO\" in a single line, if Timofey can't take the tree in such a way that it\
  \ doesn't annoy him.\n\nOtherwise print \"YES\" in the first line. In the second\
  \ line print the index of the vertex which Timofey should take in hands. If there\
  \ are multiple answers, print any of them.\n\nExamples\n\nInput\n\n4\n1 2\n2 3\n\
  3 4\n1 2 1 1\n\n\nOutput\n\nYES\n2\n\nInput\n\n3\n1 2\n2 3\n1 2 3\n\n\nOutput\n\n\
  YES\n2\n\nInput\n\n4\n1 2\n2 3\n3 4\n1 2 1 2\n\n\nOutput\n\nNO\nA: ```n = int(input())\n\
  a = {}\ncolor = {}\nsec = []\nfor i in range(1, n+1):\n    a[i] = []\n\nfor i in\
  \ range(n-1):\n    u, v = map(int, input().split())\n    a[u].append(v)\n    a[v].append(u)\n\
  \    sec.append((u, v))\n\nb = list(map(int, input().split()))\n\n\ndef check_sub_color(current_node,\
  \ color=0, parent=0):\n    if not color:\n        color = b[current_node-1]\n  \
  \  elif b[current_node-1] != color:\n        return False\n    for node in a[current_node]:\n\
  \        if node != parent and not check_sub_color(node, color, current_node):\n\
  \            return False\n    return True\n\n\ndef check(i):\n    for t in a[i]:\n\
  \        if t != i and not check_sub_color(t, parent=i):\n            return False\n\
  \    return True\n\n\nindex = -1\nf = False\nfor line in sec:\n    if b[line[0]-1]\
  \ != b[line[1]-1]:\n        f = True\n        if check(line[0]):\n            index\
  \ = line[0]\n        elif check(line[1]):\n            index = line[1]\n       \
  \ break\n\nif not f:\n    index = 1\n\nif index != -1:\n    print('YES')\n    print(index)\n\
  else:\n    print('NO')```\nQ: Write python code to solve the following coding problem\
