  \n\nOutput\n\n6.28318530717958623200\n\n\nInput\n\n73\n\n\nOutput\n\n458.67252742410977361942\n\
  A: ```R=int(input())\nprint(R*6.2831853)```\nQ: Write python code to solve the following\
