  \ \n\nOutput\n\nFor each query print a single integer \u2014 the answer to the query.\n\
  \nExamples\n\nInput\n\n\n2 5 3\n1 2 a\naab\nabab\naaa\nb\na\n2 1 1 5\n1 2 1 3\n\
  2 1 3 5\n\n\nOutput\n\n\n8\n7\n4\n\n\nInput\n\n\n9 5 6\n1 2 a\n2 7 c\n1 3 b\n3 4\
  \ b\n4 6 b\n3 5 a\n5 8 b\n5 9 c\nababa\ncabbb\nbac\nbbbac\nabacaba\n2 7 1 4\n2 5\
