  \ u, v, c = input().split()\n    u, v = int(u), int(v)\n    graph[u] = graph.get(u,\
  \ []) + [(v, c)]\n    graph[v] = graph.get(v, []) + [(u, c)]\n\nstrings = [input()\
  \ for _ in range(m)]\n\ndef lca(u, v):\n    if u > v:\n        u, v = v, u\n   \
  \ while u != v:\n        for node, c in graph[u]:\n            if node == v:\n \
  \               v = node\n                break\n            if node not in graph[v]:\n\
  \                v = node\n                break\n    return u\n\ndef query(u, v,\
  \ l, r):\n    u, v = lca(u, v)\n    res = 0\n    for node, c in graph[u]:\n    \
  \    if node == v:\n            break\n        if l <= len(strings[node-1]) <= r:\n\
  \            res += strings[node-1][l-1:r].count(c)\n    return res\n\nfor _ in\
  \ range(q):\n    u, v, l, r = map(int, input().split())\n    print(query(u, v, l,\
  \ r))````\nQ:"
