  \ u, v, c = input().split()\n    u, v = int(u), int(v)\n    if u not in graph:\n\
  \        graph[u] = []\n    if v not in graph:\n        graph[v] = []\n    graph[u].append((v,\
  \ c))\n    graph[v].append((u, c))\n\nstrings = [input() for _ in range(m)]\n\n\
  queries = []\nfor _ in range(q):\n    u, v, l, r = map(int, input().split())\n \
  \   queries.append((u, v, l, r))\n\ndef get_string(u, v):\n    if u not in graph:\n\
  \        return ''\n    if v not in graph:\n        return ''\n    path = []\n \
  \   while u != v:\n        for node, c in graph[u]:\n            if node == v:\n\
  \                path.append(c)\n                break\n        u = node\n    return\
  \ ''.join(path)\n\ndef count_string(u, v, l, r):\n    string = get_string(u, v)\n\
  \    return sum(1 for i in range(l-1, r) if strings[i][i-1] == string[i-1])\n\n\
  for u, v, l, r in queries:\n    print(count_string(u, v, l, r))````\nQ:"
